import React from "react";

function QuarriesCard(props) {
  return (
    <div className="card shadow ekipCard">
      <img src={props.picture} className="card-img-top" alt="..." />
      <div className="card-body">
        <h5 className="card-title">{props.quarries}</h5>
        <p className="card-text">{props.company}</p>
        <a href="/antalyaelmali1" className="btn btn-dark">
          {props.title}
        </a>
      </div>
    </div>
  );
}

export default QuarriesCard;
